import React, { useState } from 'react';
import { Paper, Grid, TextField, Button, IconButton } from '@material-ui/core';
import SwapHorizIcon from '@material-ui/icons/SwapHoriz';
import '/Users/dhruv590/Projects/flight-reservation-system-main/src/styles.css'; // Make sure this path is correct

const FlightBooking = () => {
  const [from, setFrom] = useState('');
  const [to, setTo] = useState('');
  const [departDate, setDepartDate] = useState('');
  const [returnDate, setReturnDate] = useState('');

  const swapLocations = () => {
    let temp = from;
    setFrom(to);
    setTo(temp);
  };

  return (
    <div className="root">
      <Paper elevation={3} className="flightBookingPaper">
        <Grid container spacing={2} className="gridContainer">
          <Grid item xs={12} sm={3}>
            <TextField
              id="from"
              label="From"
              variant="outlined"
              fullWidth
              value={from}
              onChange={(e) => setFrom(e.target.value)}
              className="inputField"
            />
          </Grid>
          <Grid item>
            <IconButton color="default" className="swapButton" onClick={swapLocations}>
              <SwapHorizIcon />
            </IconButton>
          </Grid>
          <Grid item xs={12} sm={3}>
            <TextField
              id="to"
              label="To"
              variant="outlined"
              fullWidth
              value={to}
              onChange={(e) => setTo(e.target.value)}
              className="inputField"
            />
          </Grid>
          <Grid item xs={12} sm={3}>
            <TextField
              id="depart-date"
              label="Depart Date"
              type="date"
              variant="outlined"
              fullWidth
              value={departDate}
              onChange={(e) => setDepartDate(e.target.value)}
              className="inputField"
              InputLabelProps={{
                shrink: true,
              }}
            />
          </Grid>
          <Grid item xs={12} sm={3}>
            <TextField
              id="return-date"
              label="Return Date"
              type="date"
              variant="outlined"
              fullWidth
              value={returnDate}
              onChange={(e) => setReturnDate(e.target.value)}
              className="inputField"
              InputLabelProps={{
                shrink: true,
              }}
            />
          </Grid>
          <Grid item xs={12}>
            <Button variant="contained" className="findButton">
              Find Trains
            </Button>
          </Grid>
        </Grid>
      </Paper>
    </div>
  );
};

export default FlightBooking;
